import React from 'react';
import './css/home.css';

function Home() {
  return (
    <div className="home">
      <video autoPlay loop muted className="home-video">
        <source src="/assets/videos/bgvid.mp4" type="video/mp4" />
      </video>
      <div className="home-content">
        <h1>Welcome to Travel Tribe</h1>
        <p>Plan your trip with us and explore amazing destinations!</p>
        <button className="home-button">Register Now</button>
      </div>
    </div>
  );
}

export default Home;
